import styled from "styled-components";


const StyledRooms = styled.div`
  z-index: 5;
`;

const Rooms = () => {
  return (
    <StyledRooms>

      <p
        style={{
          fontSize: "16px",
          fontWeight: 700,
          letterSpacing: "2px",
          marginLeft: "22px",
        }}
      >
        ACTIVE GAMES (4)
      </p>
    </StyledRooms>
  );
};

export default Rooms;
